func maxCoins(piles []int) int {
	sum := 0
	triples := len(piles) / 3
	sort.Ints(piles)

	piles = piles[triples:]

	for i := 0; i < len(piles); i += 2 {
		sum += piles[i]
	}

	return sum
}

func insertionSort(arr []int) {
	n := len(arr)
	for i := 1; i < n; i++ {
		key := arr[i]
		j := i - 1
		for j >= 0 && arr[j] > key {
			arr[j+1] = arr[j]
			j--
		}
		arr[j+1] = key
	}
}
